import React, { Component } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import "../node_modules/react-vis/dist/style.css";
import "./App.css";
import Home from "./Home";
import Header from "./Header";
import { Hint, 
         XYPlot,
          LineSeries,
          VerticalGridLines,
          HorizontalGridLines,
          XAxis, YAxis,
           VerticalBarSeries,
          HorizontalBarSeries,
           HeatmapSeries,
          RadialChart } from "react-vis";

class App extends Component {
  state={
    value:false
  }
  render() {
    const{value} = this.state;
    const data = [
      {x: 1, y: 0, color: 10},
      {x: 1, y: 5, color: 10},
      {x: 1, y: 10, color: 6},
      {x: 1, y: 15, color: 7},
      {x: 2, y: 0, color: 12},
      {x: 2, y: 5, color: 2},
      {x: 2, y: 10, color: 1},
      {x: 2, y: 15, color: 12},
      {x: 3, y: 0, color: 9},
      {x: 3, y: 5, color: 2},
      {x: 3, y: 10, color: 6},
      {x: 3, y: 15, color: 12}
    ];
    return (
      <div className="App" style={{ backgroundColor: "" }}>
        <Router>
          <Switch>
            <Route path="/">
              <Header />
              <XYPlot height={300} width={300}>
                <VerticalGridLines />
                <HorizontalGridLines />
                <XAxis />
                <YAxis />
                <LineSeries data={data} /></XYPlot>

                <XYPlot height={300} width={300}>
                <VerticalGridLines />
                <HorizontalGridLines />
                <XAxis />
                <YAxis />
                <VerticalBarSeries data={data} /></XYPlot>

                <XYPlot height={300} width={300}>
                <VerticalGridLines />
                <HorizontalGridLines />
                <XAxis />
                <YAxis />
                <HorizontalBarSeries data={data} />
              </XYPlot>

              <XYPlot height={300} width={300}>
                <XAxis />
                <YAxis />
                <HeatmapSeries className="heatmap-series-example" 
                onValueMouseOver={v => this.setState({value:v})}
                onSeriesMouseOut={v => this.setState({value:false})} data={data}/>
                {value !== false && <Hint value={value}/>}
              </XYPlot>

              <RadialChart data={ata} width={300} height={300} />


            </Route>
          </Switch>
        </Router>
      </div>
    );
  }
}
export default App;
